import React, { Component } from 'react';
import { NavigationBar } from './components/navbar/navbar.component';
import { AboutMe } from './components/aboutme/aboutme.component';
import {CardList} from './components/experience-list/experience-list.component';
const classlist = require('./data/classes.json');


class App extends Component {

    render() {
      return (
        <React.Fragment>
          <NavigationBar />
          <AboutMe/>
          <CardList {...classlist = classlist}/>

        </React.Fragment>


      );
    }
  }




export default App;
